import './App.css';
import Navbar from './components/Navbar';
import TextForm from './components/TextForm'; // Note: Changed from textForm to TextForm (assuming it's a component)

function App() {
  return (
    <>
      <Navbar title="TextUtil" about="About us" />
      <div className="container">
        <TextForm />
      </div>
    </>
  );
}

export default App;
